function shuffleArray(array) {
    // https://stackoverflow.com/a/12646864/8971202
    for (let i = array.length - 1; i > 0; i--) {
        const j = Math.floor(Math.random() * (i + 1));
        [array[i], array[j]] = [array[j], array[i]];
    }
    return array;
}

function copyToClipboard(text) {
    // https://stackoverflow.com/a/33928558/8971202
    if (window.clipboardData && window.clipboardData.setData) {
        // Internet Explorer-specific code path to prevent textarea being shown while dialog is visible.
        return clipboardData.setData("Text", text);

    }
    else if (document.queryCommandSupported && document.queryCommandSupported("copy")) {
        var textarea = document.createElement("textarea");
        textarea.textContent = text;
        textarea.style.position = "fixed";  // Prevent scrolling to bottom of page in Microsoft Edge.
        document.body.appendChild(textarea);
        textarea.select();
        try {
            return document.execCommand("copy");  // Security exception may be thrown by some browsers.
        }
        catch (ex) {
            console.warn("Copy to clipboard failed.", ex);
            return false;
        }
        finally {
            document.body.removeChild(textarea);
        }
    }
}

function showTooltip(copied) {
    message = copied ? 'Copied to clipboard succesfully.' : 'Something went wrong during copying to clipboard, check console.';
    // alert(message);
    console.log(message);
}

const gifs = shuffleArray(gifsJson);

var app = new Vue({
  el: '#app',
  data: {
    gifs: gifs,
    query: ''
  },
  methods: {
    copy: function (gif) {
        copied = copyToClipboard(gif.url);
        showTooltip(copied);
    }
  },
  directives: {
    focus: {
      inserted: function (el) {
        el.focus()
      }
    }
  }
})